[include shell_command.cfg]
[virtual_sdcard]
path: /home/biqu/printer_data/gcodes
on_error_gcode: CANCEL_PRINT

#[include ADXL345_v2.cfg]

[include mainsail.cfg]

[include heatsoak.cfg]
[include scanner.cfg]
#[include timelapse.cfg]
[include timelapse.cfg]
[include macros.cfg]
#[include Adaptive_Mesh.cfg]
#[include Line_Purge.cfg]
[exclude_object]
#[include motion_xy.cfg]
#[include board_pins.cfg]


[mcu]
canbus_uuid: cf516d9910f5
#serial: /dev/serial/by-id/usb-Klipper_stm32h723xx_3A002F001751313434373135-if00
#restart_method: command

[mcu EBBCan]
canbus_uuid: 3cbbae974f77


#####################################################################
# 	X/Y Stepper Settings
#####################################################################

## X Stepper on MOTOR0(B Motor)
# Motor1
[stepper_x]
step_pin: PE6
dir_pin: !PE5
enable_pin: !PC14
microsteps: 16
rotation_distance: 40
endstop_pin:  ^EBBCan: PB6
position_endstop: 260
position_min: -5
position_max: 260
homing_speed: 200

#[tmc2209 stepper_x]
#uart_pin: PC13
##diag_pin: PF4 
#run_current: 1.2
#stealthchop_threshold: 999999

[tmc5160 stepper_x]
cs_pin: PC13
spi_software_mosi_pin: PG6
spi_software_miso_pin: PG7
spi_software_sclk_pin: PG8
#diag1_pin: PF4
run_current: 1.2
stealthchop_threshold: 999999
sense_resistor: 0.075


## Y Stepper on MOTOR1 (A Motor)
# Motor2
[stepper_y]
step_pin: PE2
dir_pin: !PE1
enable_pin: !PE4
microsteps: 16
rotation_distance: 40
endstop_pin: ^PF3
position_endstop: 265
position_max: 265
homing_speed: 200

#[tmc2209 stepper_y]
#uart_pin: PE3
##diag_pin: PF3
#run_current: 1.2
#stealthchop_threshold: 999999

[tmc5160 stepper_y]
cs_pin: PE3
spi_software_mosi_pin: PG6
spi_software_miso_pin: PG7
spi_software_sclk_pin: PG8
#diag1_pin: PF3
run_current: 1.2
stealthchop_threshold: 999999
sense_resistor: 0.075


#####################################################################
# 	Extruder Stepper and EBB36 Settings
#####################################################################

# Motor3
[extruder]
step_pin: EBBCan: PD0
dir_pin: EBBCan: PD1
enable_pin: !EBBCan: PD2
microsteps: 16
full_steps_per_rotation: 200
rotation_distance: 4.637
nozzle_diameter: 0.400
filament_diameter: 1.750
heater_pin: EBBCan: PB13 # HE0
sensor_pin: EBBCan: PA3 # T0
sensor_type: PT1000
pullup_resistor: 2200
#control: pid
#pid_Kp: 20.837
#pid_Ki: 1.037
#pid_Kd: 104.708
min_temp: 0
max_temp: 300
min_extrude_temp: 0
#max_extrude_only_distance: 1400.0
#max_extrude_only_velocity: 120.0
#max_extrude_only_accel: 1500.0
#max_extrude_cross_section: 20000.0 


[adxl345]
cs_pin: EBBCan: PB12
spi_software_sclk_pin: EBBCan: PB10
spi_software_mosi_pin: EBBCan: PB11
spi_software_miso_pin: EBBCan: PB2
axes_map: x,y,z

[resonance_tester]
probe_points: 140, 130, 30
accel_chip: adxl345
accel_per_hz: 125


[tmc2209 extruder]
uart_pin: EBBCan: PA15
run_current: 0.850
stealthchop_threshold: 999999
sense_resistor: 0.110

[fan]
pin: EBBCan: PA0

[heater_fan hotend_fan]
pin: EBBCan: PA1
heater: extruder
heater_temp: 50.0

#####################################################################
# 	Z Stepper Settings
#####################################################################
## Motor6
[stepper_z]
step_pin: PG9
dir_pin: !PD7
enable_pin: !PG11 
microsteps: 16
rotation_distance: 2
endstop_pin: probe:z_virtual_endstop
position_max: 270
position_min: -50
#position_endstop: 0
homing_speed: 4
homing_retract_dist: 0

[tmc2209 stepper_z]
uart_pin: PG10
run_current: 1.0
stealthchop_threshold: 999999
sense_resistor: 0.110


## Motor7
[stepper_z1]
step_pin: PD4
dir_pin: !PD3
enable_pin: !PD6
microsteps: 16
rotation_distance: 2

[tmc2209 stepper_z1]
uart_pin: PD5
run_current: 1.0
stealthchop_threshold: 999999
sense_resistor: 0.110

## Motor8
[stepper_z2]
step_pin: PC7
dir_pin: !PC8
enable_pin: !PD2
microsteps: 16
rotation_distance: 2

[tmc2209 stepper_z2]
uart_pin: PC6
run_current: 1.0
stealthchop_threshold: 999999
sense_resistor: 0.110



#####################################################################
# 	Z Tilt Settings
#####################################################################

[z_tilt]
z_positions:
  55,  15 # Front Left
  140, 265  # Rear
  260, 10  # Front Right
points:
  10,  0    # Front Left 
  #10,  220    # Back Left
  #250, 220    # Back Right
  135, 220   # Rear    
  250, 0    # Front Right 
 
speed: 300
horizontal_move_z: 10.0
retries: 15
retry_tolerance: 0.002

[scanner]
#scanner_touch_z_offset: 0.125         
#this is the default and will be overwritten and added to the DO NOT SAVE area by using UI to save z offset

[skew_correction] 




#####################################################################
# 	Heater Bed Settings
#####################################################################

[heater_bed]
heater_pin: PA0
sensor_pin: PB1 # TB 
sensor_type: EPCOS 100K B57560G104F
#control: pid
#pid_kp: 62.901
#pid_ki: 1.808
#pid_kd: 547.241
min_temp: 0
max_temp: 130


# Manta M8P Fans
[multi_pin manta_fan_pins]
pins: PF9, PF6, PF8, PA4

[controller_fan Manta_M8P_Controller_Fan]
pin: multi_pin: manta_fan_pins
kick_start_time: 0.5  # Time to ensure the fan starts up
cycle_time: 0.01
idle_timeout: 180  # Time (in seconds) to keep the fan running after motors stop
max_power: 1.0  # Full power (100%)
shutdown_speed: 0  # Fan turns off when the motors stop
stepper: stepper_x, stepper_y, stepper_z, stepper_z1, stepper_z2


